import React, { Fragment } from 'react';
import { connect } from 'react-redux';
import { logout } from '../../actions/auth';
import PropTypes from 'prop-types';
import './general.css';

const Footer = ({ auth: { isAuthenticated, loading, user }, logout }) => {
  // Add class to change login to logout
  const authLinks = (
    <div className="navbar-right">
      <a className="footer" href="/">Home</a>
      <a className="footer" href="/contact">Contact Us</a>
      <a className="footer" href="/tests">Result History</a>
      <a className="footer" onClick={logout} href="/">Logout</a>
    </div>
  );


  const guestLinks = (
    <div>
      <a className="footer" href="/">Home</a>
      <a className="footer" href="/contact">Contact Us</a>
      <a className="footer" href="/login">Login</a>
    </div>
  );

  return (
    <div className="footer">
      <div className="navbar-header">
        <p>Crescentech</p>
      </div>
      {!loading && (<Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>)}
    </div>
  );
};

Footer.propTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  user: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  user: state.user
});

export default connect(mapStateToProps, { logout })(Footer);
